import React from 'react'
import { StyleSheet, Button, TouchableHighlightBase } from 'react-native'

interface Props {
    icon: string,
    onClick: () => void,
}

const Buttons: React.FC<Props> = (props) => {
    return (
        <TouchableHighlightBase title='teste' onPress={props.onClick} >

        </TouchableHighlightBase>
    )
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
});

export default Buttons
